import React, {Component} from 'react';

class Timer extends Component {
    state = {
        hours: 79,
        minutes: 50,
        seconds: 45
    }
    render() {
        const { hours, minutes, seconds } = this.state
        return (
            <div>
                <h1>Time Remaining: { hours } : { minutes } : { seconds } </h1>
            </div>
        )
    }
}

export default Timer;
